import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const colors = theme.palette.colors;

  return {
    container: {
      background: colors.green,
      width: "100vw"
    },
    logoContainer: {
      display: "flex",
      flexDirection: "row",
      padding: 5
    },
    logo: {
      fontSize: "40px"
    },
    name: {
      color: "white",
      marginLeft: 5,
      fontSize: "30px",
      fontFamily: "Arizonia"
    },
    links: {
      display: "flex",
      justifyContent: "flex-end"
    },
    link: {
      color: "white",
      textDecoration: "none"
    }
  };
});
